  false,\n\t\"url\": null,\n\t\"notes\": \"This is a listing of creative workspaces,
  performance venues, and exhibition venues collected through CAMP: The Cultural Asset
  Mapping Project. CAMP is an initiative of the Economic Development Department to
  map arts and cultural facilities in Austin. The entries in this dataset were compiled
  by the CAMP team within the Cultural Arts Division and collected through council
  district community mapping sessions and online surveys conducted over the summer
  of 2016. This dataset is only an excerpt of the complete CAMP dataset which will
  be available in early 2017. For more information on how this dataset was created,
  visit www.austintexas.gov/culturemapping or contact camp@austintexas.govnnThis dataset
  represents only the information collected by Cultural Arts Division staff and community
  input through the 2016 Cultural Asset Mapping Project and does not represent an
  on-the-ground survey. This product has been produced by the Economic Development
  Department of the City of Austin for the sole purpose of informational reference.
  No warranty is made by the City of Austin regarding specific accuracy or completeness.\",\n\t\"license_title\":
